import { routeGuard } from '../../../router/guard'

export default [
    {
        path: '/ecommerce',
        name: 'E-Commerce',
        beforeEnter: routeGuard,
        component: () =>
            import ('../views/Index.vue')
    },
    {
        path: '/ecommerceProdutos',
        name: 'E-Commerce Produtos',
        beforeEnter: routeGuard,
        component: () =>
            import ('../views/Produtos.vue')
    },
    {
        path: '/SyncAnyMarket',
        name: 'Sincronizar AnyMarket',
        beforeEnter: routeGuard,
        component: () =>
            import ('../views/SyncAnyMarket.vue')
    },
    {
        path: '/ecommercePedidos',
        name: 'E-Commerce Pedidos',
        beforeEnter: routeGuard,
        component: () =>
            import ('../views/Pedidos.vue')
    },
    {
        path: '/ecommercePedidosAssistencias',
        name: 'E-Commerce Pedidos Assistencias',
        beforeEnter: routeGuard,
        component: () =>
            import ('../views/PedAssistencias.vue')
    },
    {
        path: '/ecommerceDashboard',
        name: 'Dashboard E-commerce',
        beforeEnter: routeGuard,
        component: () =>
            import ('../views/Dashboard.vue')
    },
    {
        path: '/ecommerceDocas',
        name: 'Docas E-commerce',
        beforeEnter: routeGuard,
        component: () =>
            import ('../views/Docas.vue')
    }
]
